### YamlMime:PythonClass
uid: azure.mgmt.networkcloud.models.CommandOutputOverride
name: CommandOutputOverride
fullName: azure.mgmt.networkcloud.models.CommandOutputOverride
module: azure.mgmt.networkcloud.models
summary: CommandOutputOverride represents an overridden value for the command output
  settings.
constructor:
  syntax: 'CommandOutputOverride(*, associated_identity: _models.IdentitySelector
    | None = None, command_output_type: str | _models.CommandOutputType | None = None,
    container_url: str | None = None, **kwargs: Any)'
  keywordOnlyParameters:
  - name: associated_identity
    description: 'The selection of the managed identity to use with this storage

      account container. The identity type must be either system assigned or user
      assigned.'
    defaultValue: None
    types:
    - <xref:azure.mgmt.networkcloud.models.IdentitySelector>
  - name: command_output_type
    description: 'The type of command output for the override. Known values are:

      "BareMetalMachineRunCommand", "BareMetalMachineRunDataExtracts",

      "BareMetalMachineRunReadCommands", "StorageRunReadCommands", and

      "BareMetalMachineRunDataExtractsRestricted".'
    defaultValue: None
    types:
    - <xref:str>
    - <xref:azure.mgmt.networkcloud.models.CommandOutputType>
  - name: container_url
    description: 'The URL of the storage account container that is to be used by the

      specified identities.'
    defaultValue: None
    types:
    - <xref:str>
